import React from "react";
import "./styles.scss";
export function Description() {
  return (
    <div className="Description">
      <div>
        <h1 className="Description__title">More than just shorter links</h1>
        <p className="Description__text">
          Build your Brand with recognition and get detailed insights on how
          your links are performing
        </p>
        <button className="Description__button">Sign Up</button>
      </div>
      <img
        src={require("../../assets/images/illustration-working.svg")}
        alt=""
        className="Description__img"
      />
    </div>
  );
}
